INSERT INTO `pt_material_text` VALUES ('2', '2de6943bf92b5cfaef7cc8415109b96e', '15kzc4', '${userName}\n【招生专栏】中小培训机构招生的10大黄金法则\n\\n校长邦CCO老游倾情奉献。\n【策略干货】打造“网红式的影响力”网红讲师陈晓璐教你如何成为网红。', '1531919492', '1');
INSERT INTO `pt_material_text` VALUES ('3', '52b86171bc331ec7d5ee9696746fdeaa', '9LzBL', '我知道我们现在还是陌生人，但我真的很想多了解你一点?。\n给我点线索吧?，你是在客户方还是代理方呢？\n回复\n【A】广告代理方\n【B】客户方', '1532242406', '1');
INSERT INTO `pt_material_text` VALUES ('4', 'f068c624da72580daf2c04174edfe42b', '1mtwU2', '嗨?，${userName}！\n欢迎光临Brandigo，请问你想选择英文对话还是中文对话？\n回复:\n【A】英文 ??\n【B】中文 ??', '1532242806', '1');
INSERT INTO `pt_material_text` VALUES ('5', '8390c3c1c5dd33c7ed2ce6c8c7b8bae5', 'LO7No1', '我们敬佩你的耐心?‍♂️，也希望咖啡没有辜负你的无数个不眠夜?。\n请问你的公司?是什么类型呢？\n回复\n【A】技术流⚙\n【B】公关媒体类?\n【C】综合类?\n【D】其他', '1532242923', '1');
INSERT INTO `pt_material_text` VALUES ('6', 'b2ccdfbaff079529eff4ddd2a0aca396', '8rDyV1', '哇，我们难道不是天作之合吗?？和我约个时间吃吃饭聊聊天呗。\n你想去哪儿？\n回复\n【A】有情调的小酒吧?\n【B】精致的咖啡厅☕\n【C】都不想！哎哟喂，这个人好奇怪啊！?', '1532243063', '1');
INSERT INTO `pt_material_text` VALUES ('7', '43b8abc084304bf5e2f1cc1d2357ee6b', '1xqDQ4', '我们很像呢，和我约个时间聊聊天呗。\n你想去哪儿？?\n回复\n【A】有情调的小酒吧?\n【B】精致的咖啡厅☕\n【C】都不想！哎哟喂，这个人好奇怪啊！?', '1532243159', '1');
INSERT INTO `pt_material_text` VALUES ('8', '4783a7434cd73b6e046eaa23de8bc993', 'BV6D72', '没想到你和我想的一样！我们真是心有灵犀?！\n留下你的电子邮箱?，常常联络嘛！\n如：SZhang@brandigo.com', '1532243294', '1');
INSERT INTO `pt_material_text` VALUES ('9', '710a32204772f26e22780f2c0146e02c', 'rR536', '嗯?，那你想了解些什么呢？\n回复\n【A】品牌策略\n【B】社交媒体营销\n【C】都想了解?\n【D】暂不需要，就想随便聊聊天?', '1532248615', '1');
INSERT INTO `pt_material_text` VALUES ('10', 'aaba4de4db7ddddfc87e9cd7d641042a', 'YHGeL', '我正好也想找人聊聊呢。\n话说你想不想要一副免费的扑克牌?？\n回复\n【A】我想要?~\n【B】下次吧?！', '1532248699', '1');
INSERT INTO `pt_material_text` VALUES ('11', '51cd2e9cbdb6b98a7b1d00990eb91a28', '905TY', '先不要急着走啊，我们还准备了一些小惊喜...\n你喜欢扑克牌吗？?\n从1-10，为自己的牌技评个分吧！', '1532248803', '1');
INSERT INTO `pt_material_text` VALUES ('12', '470e5925566db79c842ea5cf01b648d6', 'llHYB4', '哇，我想要多了解你一点儿，好的嘛?？\n你想去哪儿坐坐呢？\n回复\n【A】有情调的小酒吧?\n【B】精致的咖啡厅☕\n【C】都不想！哎哟喂，这个人好奇怪啊！?', '1532275374', '1');
