INSERT INTO `pt_material_text` VALUES ('36', '62321fbd3bb5e4084468b28a0d3d1590', 'VWx0h', '?hellochina@brandigo.com', '1532484121', '1');
INSERT INTO `pt_material_text` VALUES ('37', '0c51546cfddedffdd6413c0407ed9725', 'GaiI11', '好吧，我猜你只是不用邮箱，并不是不想和我们交朋友，对吧?。', '1532484165', '-1');
INSERT INTO `pt_material_text` VALUES ('38', 'ed4e14a997f9b0fe317435e09f3e6dd7', 'j67m21', 'Keeping the mystery alive?, nice.\n Can we interest you in a joke?\nPlease reply:\n[A] Give me the best you got ?\n[B] Don’t even bother', '1532484212', '1');
INSERT INTO `pt_material_text` VALUES ('39', 'e1f549720a5a8dd4ab0e6788bb123622', 'bRAex2', 'Sounds great?! Leave us your details and we’ll follow up with you\nPlease leave your e-mail below:\ne.g. leo@brandigo.com', '1532484265', '1');
INSERT INTO `pt_material_text` VALUES ('40', 'b41ef384b91047df518326ad27bb2564', 'cPwG12', 'Yikes?, we’ve obviously been misreading your signals. \nYou must have a great poker face - would you like a free deck of cards? \nWe think they’d be right up your alley?…\nPlease reply:\n[A] Yes\n[B] No', '1532484335', '1');
INSERT INTO `pt_material_text` VALUES ('41', '2b006abedd381367c625783ea8ae5511', 'bYMPO', 'Tough crowd. we’ll be here if you change your mind?.', '1532484353', '1');
INSERT INTO `pt_material_text` VALUES ('42', 'f49da9d4cccdacccabe89e6987b21559', 'Kk78g3', 'As exciting as PDF’s are, we’ve got something that might really tickle your fancy?... \non a scale of 1 - 10, how good is your poker face??', '1532503419', '1');
INSERT INTO `pt_material_text` VALUES ('43', 'b0c2193d251d4ea47e1cc3d2c687c709', 'zVN8D4', 'Well then you may need to practice?. How about a free deck of playing cards with China marketing tips on the back??\nPlease reply:\n[A] Yes\n[B] No', '1532503455', '1');
INSERT INTO `pt_material_text` VALUES ('44', '105730c1fbd8b9b6f868998c27c0bef0', 'Oom1U', 'As cocky as we expected. We’ve got the perfect gift? for you.', '1532503476', '1');
INSERT INTO `pt_material_text` VALUES ('45', '4c9045c578c1311c4b7401960bb554fc', 'XiKpr2', 'Should we send you some??\nPlease reply:\n[A] Yes\n[B] No', '1532503501', '1');
INSERT INTO `pt_material_text` VALUES ('46', '61762d2f64bb24009381177febadb7fe', 'uQtp6', 'What do you call a tick on the moon??', '1532503680', '1');
INSERT INTO `pt_material_text` VALUES ('47', '3eecf3967777d2d6e0056c3ce6d55e03', 'nvS1o', 'Pretty funny right?\nPlease reply:\n[A] Hilarious?\n[B] I’ve heard better?\n[C] I hope this isn’t your day job?', '1532503695', '1');
INSERT INTO `pt_material_text` VALUES ('48', '8dc8f622464d72af88b118ade249dbf5', 'yMWg72', 'It seems like you appreciate good fun?. You’d love our customized playing cards.\nWould you like a free deck??\nPlease reply:\n[A] Yes?\n[B] No?', '1532503729', '1');
INSERT INTO `pt_material_text` VALUES ('49', '5f384b394410566af7579285035f5fd7', 'G0nqV4', 'I respect that?. You know what... can we interest you in a free deck of playing cards? \nPlease reply:\n[A] Yes\n[B] No', '1532503835', '1');
INSERT INTO `pt_material_text` VALUES ('50', 'f8e38dfbcf3f0250f05e12ca6c478a2f', 'G0NEa1', '??‍♂️Hey, ${userName}', '1532505119', '1');
INSERT INTO `pt_material_text` VALUES ('51', '3ed2c7a12120bcda1a5d4927c610a2a9', '6cTQx2', 'psssst, you there??', '1532505129', '1');
INSERT INTO `pt_material_text` VALUES ('52', '1391f63fe9c1ff8709301acccd3124ec', 'wqr5b3', 'I was so excited to send you our card deck that I forgot to share my email.\nI hope this would be useful for you?.', '1532505168', '1');
INSERT INTO `pt_material_text` VALUES ('53', 'd2d2024b292fa866bbf65a426f532146', '1CxSL4', 'Cool, we’ll just assume you don’t use email and not that you don’t want to be friends?.', '1532505233', '-1');
INSERT INTO `pt_material_text` VALUES ('54', 'fd3e414e19a33b9a2e83e00348051667', '4SZuz2', '<a href=\"http://file.weiniweixiao.com/file/201808/10/a7a4a81a9c699534331f890571dbdd61.pdf\">点击下载我们的解决方案</a>', '1532536224', '1');
INSERT INTO `pt_material_text` VALUES ('55', 'b84b9f8838f3a7d1874c793b4270380d', 'v3gBh', 'Hi? ${userName}!\nThanks for following Brandigo? ! would you prefer English or Chinese?\nPlease reply:\n[A] English ??\n[B] Chinese ??', '1532575804', '1');
INSERT INTO `pt_material_text` VALUES ('56', '2ae5b44803ce7fa7f725e8d600ca6e47', '0vXCV2', 'Hi?, ${userName}!\nWelcome back! Very nice to see you again?! Do you prefer English or Chinese?\nPlease reply:\n[A]  English ??\n[B]  Chinese ??', '1532576028', '1');
INSERT INTO `pt_material_text` VALUES ('57', '3ae626268ca70a4b3a561668b5627a9a', 'qd8nZ4', '请问您需要怎样的帮助?？', '1532760118', '1');
INSERT INTO `pt_material_text` VALUES ('58', 'cfe6205d1b7025fad5940ebf917a344b', 'tSRpn', 'okok, how can we help you??', '1532760137', '1');
INSERT INTO `pt_material_text` VALUES ('59', '119b811fe32057ec0e6f4e5ae4504c75', 'lanhN2', '还在线吗，继续聊嘛?！', '1532760792', '1');
INSERT INTO `pt_material_text` VALUES ('60', '040b692b450b079b0384e67e0cd99577', 'RSLWF3', 'Are you there? Let\'s keep going?!', '1532760810', '1');
INSERT INTO `pt_material_text` VALUES ('61', '797505c4f9b3235017fd6ac4e88ea045', 'BgZt12', '为了能准确地将扑克牌送到你的手上?，<a href=\"http://wechat.weiniweixiao.com/wechat/oauth\">请点击此处告诉我们你的信息哦</a>', '1532761460', '1');
INSERT INTO `pt_material_text` VALUES ('62', '9c5471aa29dd994cc714709c47361a9b', 'Lg5TL3', '<a href=\"http://wechat.weiniweixiao.com/wechat/oauth\">How can we send it to you? Click here to let us know?</a>', '1532761498', '1');
INSERT INTO `pt_material_text` VALUES ('63', '035c0edbf7031d6e912ecee379b5cdb0', 'VG8jO4', 'Gotcha! We\'ll get back to you soon?!', '1533519731', '1');
INSERT INTO `pt_material_text` VALUES ('64', 'ebb9470f0991f1694b0b2da3cbfb4d2d', 'BCkBJ4', '好的好的收到了～我会尽快联系你的?！', '1533521126', '1');
INSERT INTO `pt_material_text` VALUES ('65', '484681d58b791f2a200b527b9a8b6579', 'ct3QQ2', '不好意思，我没听懂?。可以再说一次嘛？', '1533527733', '-1');
INSERT INTO `pt_material_text` VALUES ('66', '9ce286d2adcb09453d8887b0b5d2800d', 'xPDs02', '?  ?超喜欢你！', '1533533973', '1');
INSERT INTO `pt_material_text` VALUES ('67', '2d8fb98c1fd16399fedba2d4b12541c9', 'pkLw7', 'A luna Tick!?', '1533534007', '1');
INSERT INTO `pt_material_text` VALUES ('68', '87bb9b2f8b8c76cbd48c899b185d4710', 'o3pXT', 'umm...we can\'t recognize your e-mail. Do you wanna check it again?', '1533738290', '1');
INSERT INTO `pt_material_text` VALUES ('69', 'f53b25625d21adb9188cd790df791551', 'vAqzV4', '嗯...不好意思，你是不是不小心打错了，再发一遍？', '1533738410', '1');
INSERT INTO `pt_material_text` VALUES ('70', '62071211e9c74a95259de20e99c7c6ed', 'gvAQo2', 'thank you [${userName}]!', '1533918341', '1');
INSERT INTO `pt_material_text` VALUES ('71', '6d863c0097919aa29a051084d8556e3d', 'Nfs2Q1', '谢谢【${userName}】！', '1533918359', '1');
